import React from 'react';
import { Link } from 'react-router-dom';
import styles from './home.module.css';

const Home = () => {
  return (
    <div className={styles.homeContainer}>
      <h1 className={styles.title}>Welcome to Course Planner</h1>
      <p>Plan your academic journey with ease using our course planning tool.</p>
      <Link to="/planner" className={styles.link}>Start Planning</Link>
    </div>
  );
};

export default Home;
